class GestionPdf extends CI_Controller {

    function __construct()
	{   
		parent::__construct();          
		$this->load->database();
        $this->load->helper(array('form', 'url'));
        $this->load->library('table');
		$this->load->library('pagination');
		$this->load->database(); //load library database

    }
    
	public function index()
	{
		//no se admiten personas sin login
		if(!isset($_SESSION['usuario'])){
			redirect('Welcome/index',"refresh");
		}
		//no se admiten alumnos
		if($_SESSION['rol']==3){
			redirect('Welcome/index',"refresh");
        }
        if($_SESSION['rolmultiple']==false && $_SESSION['rol']==1){
            //no se admiten solo admins
			redirect('Welcome/index',"refresh");
		}

		$this->load->view('pagePdf');
    }
    public function verpdf($info)
	{
		//info user tiene dos parametros el 1 el id del alumno el 2 la evaluacion
		$infouser=explode('x', $info, 2);
		$param['alumno']=$this->Usuario->getUser($infouser[0]);
        $param['eval']=$infouser[1];

        //getInforme($eval,$curso,$alumno,$usuario)
        if(isset($_SESSION['curso'])){
            $curso=$_SESSION['curso'];
        }else{
            //aÃ±o actual
            $curso=date("Y");
            $_SESSION['curso']= $curso;
        }
        $param['informe']=$this->Informe->getInforme($param['eval'],$curso,$infouser[0],$_SESSION['usuario']['id']);
        //echo site_url().'fpdf.php';exit;
       
        $this->load->library('Pdf');
        $pdf = new FPDF();
        $pdf->AliasNbPages();
        $pdf->AddPage();
        // Logo
        //
        $pic = "data:image/png;base64,";
        $info = getimagesize($pic);
        $pdf->Image($pic, 10, 3,($info[0]/10), ($info[1]/10), 'png');
        $pdf->Line(10, 27, 210-20, 27); 
       // $pdf->Image($pic,10,8,15);
        // Arial bold 15
        $pdf->SetFont('Arial','B',18);
        // Movernos a la derecha
        $pdf->Cell(80);
        // TÃ­tulo
        $pdf->Cell(30,10,'INFORME EVALUACION INFANTIL',0,0,'C');
        // Salto de lÃ­nea
        $pdf->Ln(20);

        $pdf->SetFont('Times','',12);
       // $pdf->Cell(0,10,'Nombre:  '. ucfirst(strtolower ($param['alumno'][0]['nombre'])) . " " . ucfirst(strtolower ($param['alumno'][0]['apellido1'])) ." " . ucfirst(strtolower ($param['alumno'][0]['apellido2'])),0,1);
        $pdf->Cell(0,10, iconv('UTF-8', 'windows-1252', "EvaluaciÃ³n: "). $param['eval'] . iconv('UTF-8', 'windows-1252', " Âª"),0,1);
        $pdf->Cell(0,10,'Tutor:  '.ucfirst(strtolower ( $_SESSION['usuario']['nombre'] ))." " . ucfirst(strtolower ($_SESSION['usuario']['apellido1'])) . " " .ucfirst(strtolower ( $_SESSION['usuario']['apellido2'])),0,1);


        $pdf->Multicell(0,10, iconv('UTF-8', 'windows-1252',$param['informe'][0]['texto']),0,1);
        $pdf->Output();
        
		//$this->load->view('pagePdf');
    }
